import './App.css';
import AboutUs from './components/AboutUs';
import ClientSection from './components/ClientSection';
import Footer from './components/Footer';
import InfoSection from './components/InfoSection';
import Landing from './components/Landing';
import Navbar from './components/Navbar';
import Projects from './components/Projects';
import Contact from './components/Contact'
import Services from './components/Services';
import { BrowserRouter, Router, Route, Switch } from "react-router-dom";


function App() {
  return (
    <Router>
      <div className="App">
      <Navbar />
      <Landing />
      <AboutUs />
      <ClientSection />
      <Services />
      <InfoSection
        InfoSectionHeading='Dorit Airport - South Sudan'
        InfoSectionDetails='The kick start of the new Dorit land mark has begun  with high-end survey solutions produced with the latest technology.'
        InfoSectionLinkName='See Project Details'
        img="energy.jpg"
      />
      <Projects />
      <InfoSection
        InfoSectionHeading='Careers'
        InfoSectionDetails='Our people are our business, working to provide our customers with the service they deserve.'
        InfoSectionLinkName='Work for us'
        img="workforus.jpg"
      />
      <InfoSection
                InfoSectionHeading='Meet our team'
                InfoSectionDetails='Our core team is amde up of highly trained professionals redy to deliver the best of services to you our customers.'
                InfoSectionLinkName='Team'
                img="engineering.jpg"
            />
            <Contact />
      <Footer />
    </div>
    </Router>
  );
}

export default App;
